    const [confirmPassword, setConfirmPassword] = useState("");
     const [pic, setPic] = useState("");

  return (
    <VStack spacing={4}>
     <FormControl>
        <FormLabel></FormLabel>
        <Input
          placeholder="Enter your name"
          onchange={(e)=>setName(e.target.value)}></Input>
     </FormControl>
